import { useState } from "react";
import { Navbar, Container, Nav, Dropdown, Carousel } from 'react-bootstrap';
import './App.css';
import mg from './data.js';
import { Routes, Route, useNavigate } from 'react-router-dom';
import Detail from "./pages/Detail.js";
import Login from "./pages/Login.js";
import MemberSearch from './pages/Member_search';
import MemberJoin from './pages/Member_Join';

function App() {

  let [MG] = useState(mg);
  let navigate = useNavigate();

  // Dropdown의 hover 상태를 관리하는 state
  const [showDropdown, setShowDropdown] = useState(false);

  const handleMouseEnter = () => {
    setShowDropdown(true);
  };

  const handleMouseLeave = () => {
    setShowDropdown(false);
  };

  return (
    <div className="App">

    <Navbar bg="dark" variant="dark" expand="lg">
      <Container>
        {/* 왼쪽에 로고와 메뉴 */}
        <Navbar.Brand onClick={() => { navigate('/') }} style={{ cursor: 'pointer' }}>
          GundShop
        </Navbar.Brand>
        <Nav className="me-auto">
          <Dropdown
            show={showDropdown}
            onMouseEnter={handleMouseEnter}
            onMouseLeave={handleMouseLeave}
          >
            <Dropdown.Toggle variant="dark" id="dropdown-basic">
              건담 프라모델 . 기타
            </Dropdown.Toggle>

            <Dropdown.Menu>
              <Dropdown.Item onClick={() => { navigate('/gundam-models') }}>건담 프라모델</Dropdown.Item>
              <Dropdown.Item onClick={() => { navigate('/other-models') }}>기타 프라모델</Dropdown.Item>
              <Dropdown.Item onClick={() => { navigate('/tools') }}>조립 도구</Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>
        </Nav>

        {/* 오른쪽에 로그인, 회원가입 */}
        <Nav className="ms-auto">
          <Nav.Link onClick={() => { navigate('/login') }}>로그인</Nav.Link>
          <Nav.Link onClick={() => { navigate('/join') }}>회원가입</Nav.Link>
        </Nav>
      </Container>
    </Navbar>

      <Routes>
        <Route path="/" element={
          <>
            {/* 메인 페이지에서만 Carousel 표시 */}
            <Carousel className="main-bg">
              <Carousel.Item>
                <img
                  className="d-block w-100"
                  src={process.env.PUBLIC_URL + '/images/bg.jpg'}
                  alt="Slide 1"
                />
                <Carousel.Caption style={{ fontSize: '38px', fontWeight: 'bold'}}>
                  건담 X 신한카드 이벤트 바로가기
                </Carousel.Caption>
              </Carousel.Item>
              <Carousel.Item>
                <img
                  className="d-block w-100"
                  src={process.env.PUBLIC_URL + '/images/bnr_top_pc.jpg'}
                  alt="Slide 2"
                />
                <Carousel.Caption>
                </Carousel.Caption>
              </Carousel.Item>
              <Carousel.Item>
                <img
                  className="d-block w-100"
                  src={process.env.PUBLIC_URL + '/images/seedfree.jpg'}
                  alt="Slide 3"
                />
                <Carousel.Caption style={{ fontWeight: 'bold' }}>
                  <p style={{ fontSize: '15px' }}>기동전사 건담</p>
                  <h2 style={{ fontSize: '38px' }}>SEED FREEDOM!</h2>
                </Carousel.Caption>
              </Carousel.Item>
            </Carousel>

            <div className="container">
              <div className="row">
                {
                  MG.map((a, i) => {
                    return (
                      <Card MG={MG[i]} i={i} key={i}></Card>
                    );
                  })
                }
              </div>
            </div>
          </>
        } />
        <Route path="/detail/:id" element={<Detail MG={MG} />} />
        <Route path="/login" element={<Login />} />
        <Route path="/search" element={<MemberSearch />} />
        <Route path="/join" element={<MemberJoin />} />
        <Route path="*" element={<div>없는페이지 입니다.</div>} />
      </Routes>
    </div>
  );
}

function Card(props) {
  return (
    <div className="col-md-4">
      <img src={process.env.PUBLIC_URL + '/images/mg' + (props.i + 1) + '.jpg'} alt="Gundam Model"/>
      <p>{props.MG.gundam_series}</p>
      <h5>{props.MG.gundam_name}</h5>
      <h4>{props.MG.price}</h4>
    </div>
  );
}

export default App;
